description:
This feature class is to record all current and future public land owned by Launceston City Council. As determined by the legislation and council decisions.

Local Government Act 1993
177A. Public land

(1)The following land owned by a council is public land:
(a)a public pier or public jetty;
(b)any land that provides health, recreation, amusement or sporting facilities for public use;
(c)any public park or garden;
(d)any land acquired under section 176for the purpose of establishing or extending public land;
(e)any land shown on a subdivision plan as public open space that is acquired by a council under the Local Government (Building and Miscellaneous Provisions) Act 1993;
(f)any other land that the council determines is public land;
(g)any other prescribed land or class of land.

(2)The general manager is to –
(a)keep lists or maps of all public land within the municipal area; and
(b)make the lists and maps available for public inspection at any time during normal business hours.

This is any land we have classified as "open space" or "for recreational purposes" or other wording to the same effect on the Sealed Plan. It is important to note that the plan must be sealed. On top of this the parcel must have been transferred to council, which you can tell from the folio text. That's why these fields have been included: Sealed Plan, Plan Notation and Transfer Date. If all three fields are populated the land parcel does not need a council decision. Note: "for drainage purposes" does not suffice.

In situations where there is no sealed plan or the sealed plan doesn't contain wording as described, there must be a council decision for it to become part of the public land list. For this the fields: council decision date and agenda item are provided. There are two fields for agenda item as some area were part approved in one item with the rest in another.

Direction was given by the Property Coordinator in the creation of this layer.

This layer follows cadastral boundaries where they are accurate. Where they are not, it follows the area boundary. We have excluded roads from the layer. Some areas are not whole of title. Proposed public lend is included. This has not been approved by council and does not fall into the other category described above.
